import React from 'react'
import Delete from '@material-ui/icons/Delete'
import {loadStripe} from '@stripe/stripe-js';
import { useCart, useDispatchCart } from '../components/ContextReducer';
export default function Cart() {
  let data = useCart();
  let dispatch = useDispatchCart();

  if (data.length === 0) {
    return (
      <div>
        <div className='m-5 w-100 text-center fs-3 '>The Cart is Empty!</div>
      </div>
    )
  }
  let totalPrice = data.reduce((total, food) => total + food.price, 0)

  const paytmentData = {
    "product":[
{
      price : totalPrice,
      qty : data.length,
      Pname : "Food Items"
}
    ]

  }

  const handleCheckOut = async () => {
    let userEmail = localStorage.getItem("userEmail"); 
    const stripePromise = await loadStripe("pk_test_51Nb5tWSAWolA5vHGaKM4vKJ0WEdTm6MaLbXW3heOsdBXTrN2EahXFo2i84tfzU5DS9sVoTPcz9uVOKtkCf5Mak3X00GpJZdpZI")
    let response = await fetch("http://localhost:3000/api/create-checkout-session", {

      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(
        [paytmentData,{
        order_data: data,
        email: userEmail,
        order_date: new Date().toDateString()
        }]
      )
    });

    if(response.statusCode === 500) return;

    const SIdata = await response.json()

    console.log(SIdata);

    stripePromise.redirectToCheckout({sessionId : SIdata}) 

    console.log("JSON RESPONSE:::::", response.status)

    if (response.status === 200) {
      dispatch({ type: "DROP" })
    }

  }


  return (
    <div>

      {console.log(data)}
      <div className='container m-auto mt-5 table-responsive  table-responsive-sm table-responsive-md ' >
        <table className='table table-hover '>
          <thead className=' text-success fs-4'>
            <tr>
              <th scope='col' >#</th>
              <th scope='col' >Name</th>
              <th scope='col' >Quantity</th>
              <th scope='col' >Option</th>
              <th scope='col' >Amount</th>
              <th scope='col' ></th>
            </tr>
          </thead>
          <tbody>
            {data.map((food, index) => (
              <tr>
                <th scope='row ' >{index + 1}</th>
                <td >{food.name}</td>
                <td>{food.qty}</td>
                <td>{food.size}</td>
                <td>{food.price}</td>
                <td><button type="button" className="btn p-0"><Delete onClick={() => { dispatch({ type: "REMOVE", index: index }) }} /></button> </td></tr>
            ))}
          </tbody>
        </table>
        <div><h1 className='fs-2'>Total Price: {totalPrice}/-</h1></div>
        <div>
          <button className='btn bg-success mt-5 ' onClick={handleCheckOut} > Check Out </button>
        </div>
      </div>



    </div>
  )
}
